import { Button, Modal, Navbar, Container, Card, Row, Col, Image, Accordion, ToggleButton, ToggleButtonGroup, Form, Alert, Toast } from 'react-bootstrap'


const EtIDNav = () => (
<>
<Navbar bg="dark" variant="dark">
<Navbar.Brand href="#home">
  <img
    alt=""
    src="/logo.svg"
    width="30"
    height="30"
    className="d-inline-block align-top"
  />{' '}
  Eth-ter-I-Die Add logo
</Navbar.Brand>
</Navbar>
</>
);


export default EtIDNav;
